import './App.css';
import React, { Component } from 'react';
import ReactDOM from 'react-dom/client';
import GenderDropdown from './dropdowns/genderDropdown.tsx'; // Updated import

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      selectedGender: '',
    };
  }

  handleSelectGender = (selectedOption) => {
    this.setState({ selectedGender: selectedOption.value });
  };

  handleSubmit = () => {
    const { selectedGender } = this.state;
    console.log('Selected gender:', selectedGender);
    // Add further logic for form submission
  };

  render() {
    return (
      <div className="App">
        <h1>Hello Name Generator</h1>
        <GenderDropdown onSelectGender={this.handleSelectGender} />
        {/* Add other dropdowns and form elements */}
        <button onClick={this.handleSubmit}>Submit</button>
      </div>
    );
  }
}

export default App;

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<App />);
